webpackJsonp([22745884104586],{453:function(t,e){t.exports={data:{site:{siteMetadata:{title:"Пятиминутка React",author:"Пятиминутка React"}},markdownRemark:{id:"/Users/petr/www/5minreact.ru/src/pages/058-nestjs/index.md absPath of file >>> MarkdownRemark",html:'<iframe width="100%" height="166" scrolling="no" frameborder="no" allow="autoplay" src="https://w.soundcloud.com/player/?url=https%3A//api.soundcloud.com/tracks/665536373&color=%23ff5500&auto_play=false&hide_related=true&show_comments=true&show_user=true&show_reposts=false&show_teaser=true"></iframe>\n<p>Надавно начал небольшой проект - прототип или MVP для проверки бизнес идеи. Задача пока технически не сложная, решил попробовать какой-нибудь новый для себя Node.js фреймворк. После небольшого исследования, выделилось два кандидата Nest.js и Loopback 4.</p>\n<p>Взял Nest.js. В основе хорошие дизайн-паттерны и заявка на грамотную архитектуру. Расскажу о своём небольшом опыте работы с этим фреймворком.</p>\n<ul>\n<li><a href="https://nestjs.com">https://nestjs.com</a></li>\n<li><a href="https://techtrain.ru/?utm_source=partner&#x26;utm_medium=5minphp&#x26;utm_campaign=techtrain2019&#x26;utm_content=common">https://techtrain.ru/</a></li>\n</ul>',frontmatter:{title:"Nest.js",date:"August 14, 2019",featuredImage:null}}},pathContext:{slug:"/058-nestjs/",previous:{fields:{slug:"/057-techtrain-richard-stallman-free-software/"},html:'<iframe width="100%" height="166" scrolling="no" frameborder="no" allow="autoplay" src="https://w.soundcloud.com/player/?url=https%3A//api.soundcloud.com/tracks/658433429&color=%23ff5500&auto_play=false&hide_related=true&show_comments=true&show_user=true&show_reposts=false&show_teaser=true"></iframe>\n<p>24-25 августа 2019 в Санкт-Петербурге пройдёт IT-Фестиваль TechTrain.</p>\n<p>Фестиваль - это множество активностей под одной крышей: доклады, дискуссионные зоны, митапы, стенды IT сообществ и подкастов.</p>\n<p>Среди спикеров много громких имён, в частности мой глаз зацепился за два имени: Ричард Столлман (главный по свободному ПО), Джон Ромеро (гейм дизайнер, создавший атмосферу Wolfenstein 3D, Doom и Quake)!</p>\n<p>В связи с этим в этом выпуске подкаста сделаем небольшой экскурс в историю Ричарда Столлмана и Свободного программного обеспечения.</p>\n<p>Я обязательно буду на TechTrain, и у подкастов Пятиминутка React и Пятиминутка PHP даже будет свой стенд, приходите, пообщаемся!</p>\n<ul>\n<li><a href="https://techtrain.ru/?utm_source=partner&#x26;utm_medium=5minphp&#x26;utm_campaign=techtrain2019&#x26;utm_content=common">https://techtrain.ru/</a> - IT-ФЕСТИВАЛЬ TechTrain!</li>\n<li><a href="http://www.gnu.org/philosophy/free-sw.ru.html">http://www.gnu.org/philosophy/free-sw.ru.html</a> - Что такое свободная программа?</li>\n<li><a href="http://www.gnu.org/philosophy/open-source-misses-the-point.html">http://www.gnu.org/philosophy/open-source-misses-the-point.html</a> - Почему “открытый исходный текст” не передает понятия “свободная программа”</li>\n</ul>',excerpt:"24-25 августа 2019 в Санкт-Петербурге пройдёт IT-Фестиваль TechTrain. Фестиваль - это множество активностей под одной крышей: доклады…",frontmatter:{title:"TechTrain, Ричард Столлман и Свободное программное обеспечение",date:"July 30, 2019",featuredImage:null}},next:null}}}});
